import React, { Component } from 'react';
import { BrowserRouter as Router, Switch } from 'react-router-dom'
import { Header } from './components/index'
import './App.css';

class App extends Component {
  render() {
    return (
      <Router>
        <Switch>
          <Route path="/" exact component={Home} />
        </Switch>
      </Router>
    );
  }
}

export default App;
